&lt;!-- DEBUG-VIEW START 1 APPPATH\Views\home\js.php --&gt;
&lt;script type=&quot;module&quot;&gt;
    $(() =&gt; {
        const sleep = 550;
        $(&#039;.card:eq(0)&#039;).hide()
        $(&#039;.card:eq(1)&#039;).hide()
        $(&#039;#carousel&#039;).hide()
        $(&#039;#hulk&#039;).hide()
        $(&#039;.small-box:eq(1)&#039;).hide()
        $(&#039;.small-box:eq(2)&#039;).hide()
        $(&#039;.small-box:eq(0)&#039;).hide().show(sleep);

        setTimeout(() =&gt; {
            $(&#039;.small-box:eq(1)&#039;).show(sleep - 200);
            setTimeout(() =&gt; {
                $(&#039;.small-box:eq(2)&#039;).show(sleep - 300);
                setTimeout(() =&gt; {
                    $(&#039;.card:eq(0)&#039;).show(sleep - 100);
                    setTimeout(() =&gt; {
                        
                        $(&#039;#carousel&#039;).show(sleep);
                        setTimeout(() =&gt; {
                            $(&#039;.card:eq(1)&#039;).show(sleep);
                            setTimeout(() =&gt; {
                                $(&#039;#hulk&#039;).show(sleep);
                            }, sleep);
                        }, sleep);
                    }, sleep);
                }, sleep - 400);
            }, sleep - 300);
        }, sleep - 200);




        $(&#039;#hulk&#039;).click(() =&gt; {
            $(&#039;.content-wrapper&#039;).addClass(&#039;animation__shake&#039;);
            setTimeout(() =&gt; {
                $(&#039;.content-wrapper&#039;).removeClass(&#039;animation__shake&#039;);
            }, 2000); // Aguarda 2 segundos antes de remover a classe
        });
    });
&lt;/script&gt;
&lt;!-- DEBUG-VIEW ENDED 1 APPPATH\Views\home\js.php --&gt;

